import React from "react";
import { useAuth0 } from "@auth0/auth0-react";

const Profile = () => {
  const { user, isAuthenticated } = useAuth0();
  const { name, picture, email } = user;

  return (
    isAuthenticated && (
        <div>
            <img src={picture} alt={user.name} />
            <h3>{name}</h3>
            <p>{email}</p>
        </div>  
    )
  )
};

export default Profile;
